import { Signer, BytesLike } from "ethers"
import { Provider, TransactionRequest } from "@ethersproject/providers"
import { Contract, ContractFactory, Overrides } from "@ethersproject/contracts"

import { DepositBox } from "./DepositBoxContractInterface"

export class DepositBoxInstanceCreator extends ContractFactory {
  constructor(signer?: Signer) {
    super(_abi, _bytecode, signer)
  }

  deploy(
    _collateralAddress: string,
    _finderAddress: string,
    _priceIdentifier: BytesLike,
    _timerAddress: string,
    overrides?: Overrides
  ): Promise<DepositBox> {
    return super.deploy(
      _collateralAddress,
      _finderAddress,
      _priceIdentifier,
      _timerAddress,
      overrides || {}
    ) as Promise<DepositBox>
  }
  getDeployTransaction(
    _collateralAddress: string,
    _finderAddress: string,
    _priceIdentifier: BytesLike,
    _timerAddress: string,
    overrides?: Overrides
  ): TransactionRequest {
    return super.getDeployTransaction(
      _collateralAddress,
      _finderAddress,
      _priceIdentifier,
      _timerAddress,
      overrides || {}
    )
  }
  attach(address: string): DepositBox {
    return super.attach(address) as DepositBox
  }
  connect(signer: Signer): DepositBoxInstanceCreator {
    return super.connect(signer) as DepositBoxInstanceCreator
  }
  static connect(address: string, signerOrProvider: Signer | Provider): DepositBox {
    return new Contract(address, _abi, signerOrProvider) as DepositBox
  }
}

